import NavBar from "./NavBar"
import yose from './yosemite.jpg'

const Header = () => {
  return (
    <div
      className='content'
      id='header'
      style={{
        backgroundImage: `url(${yose})`,
      }}>
      <NavBar />
      <div className='header-content'>
          <p
            style={{
              fontSize: `calc(10px+2vmin)`,
            }}>
            Andrew Pritchett
          </p>
          <p>
            Software Engineer | Climber
          </p>
      </div>
    </div>
  )
}

export default Header
